BEGIN TRANSACTION;
DROP TABLE IF EXISTS "search_results";
CREATE TABLE IF NOT EXISTS "search_results" (
	"user_id"	INTEGER NOT NULL,
	"area_id"	INTEGER NOT NULL,
	"priority"	INTEGER NOT NULL,
	FOREIGN KEY("area_id") REFERENCES "borough"("area_id"),
	PRIMARY KEY("user_id")
);
DROP TABLE IF EXISTS "user";
CREATE TABLE IF NOT EXISTS "user" (
	"user_id"	INTEGER NOT NULL UNIQUE,
	"name"	TEXT NOT NULL,
	"email"	TEXT NOT NULL,
	"admin"	INTEGER NOT NULL,
	"password"	TEXT NOT NULL,
	"university"	TEXT NOT NULL,
	PRIMARY KEY("user_id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "preferences";
CREATE TABLE IF NOT EXISTS "preferences" (
	"user_id"	INTEGER NOT NULL UNIQUE,
	"room_category"	INTEGER NOT NULL,
	"rent_max_price"	INTEGER NOT NULL,
	"rent_min_price"	INTEGER NOT NULL,
	"Population_per_square_kilometre"	INTEGER NOT NULL,
	PRIMARY KEY("user_id")
);
DROP TABLE IF EXISTS "borough";
CREATE TABLE IF NOT EXISTS "borough" (
	"area_id"	TEXT NOT NULL,
	"area_name"	TEXT NOT NULL,
	PRIMARY KEY("area_id")
);
DROP TABLE IF EXISTS "MPS Borough Level Crime (most recent 24 months)";
CREATE TABLE IF NOT EXISTS "MPS Borough Level Crime (most recent 24 months)" (
	"MajorText"	TEXT NOT NULL,
	"MinorText"	TEXT NOT NULL,
	"area_name"	TEXT NOT NULL,
	"201811"	INTEGER NOT NULL,
	"201812"	INTEGER NOT NULL,
	"201901"	INTEGER NOT NULL,
	"201902"	INTEGER NOT NULL,
	"201903"	INTEGER NOT NULL,
	"201904"	INTEGER NOT NULL,
	"201905"	INTEGER NOT NULL,
	"201906"	INTEGER NOT NULL,
	"201907"	INTEGER NOT NULL,
	"201908"	INTEGER NOT NULL,
	"201909"	INTEGER NOT NULL,
	"201910"	INTEGER NOT NULL,
	"201911"	INTEGER NOT NULL,
	"201912"	INTEGER NOT NULL,
	"202001"	INTEGER NOT NULL,
	"202002"	INTEGER NOT NULL,
	"202003"	INTEGER NOT NULL,
	"202004"	INTEGER NOT NULL,
	"202005"	INTEGER NOT NULL,
	"202006"	INTEGER NOT NULL,
	"202007"	INTEGER NOT NULL,
	"202008"	INTEGER NOT NULL,
	"202009"	INTEGER NOT NULL,
	"202010"	INTEGER NOT NULL
);
DROP TABLE IF EXISTS "housing-density-borough";
CREATE TABLE IF NOT EXISTS "housing-density-borough" (
	"area_id"	TEXT NOT NULL UNIQUE,
	"area_name"	TEXT NOT NULL,
	"Year"	INTEGER NOT NULL,
	"Source"	TEXT NOT NULL,
	"Population"	INTEGER NOT NULL,
	"Inland_Area_Hectares"	REAL NOT NULL,
	"Total_Area_Hectares"	REAL NOT NULL,
	"Population_per_hectare"	REAL NOT NULL,
	"Square_Kilometres"	REAL NOT NULL,
	"Population_per_square_kilometre"	INTEGER NOT NULL,
	PRIMARY KEY("area_id")
);
DROP TABLE IF EXISTS "privaterentalmarketstatistics11122020";
CREATE TABLE IF NOT EXISTS "privaterentalmarketstatistics11122020" (
	"area_id"	TEXT NOT NULL UNIQUE,
	"area_name"	TEXT NOT NULL,
	"room_median_price"	INTEGER,
	"studio_median_price"	INTEGER,
	"one_bed_median_price"	INTEGER,
	"two_bed_median_price"	INTEGER,
	"three_bed_median_price"	INTEGER,
	"four_plus_bed_median_price"	INTEGER,
	PRIMARY KEY("area_id")
);
DROP TABLE IF EXISTS "green_cover_borough";
CREATE TABLE IF NOT EXISTS "green_cover_borough" (
	"area_name"	TEXT NOT NULL,
	"area_id"	TEXT NOT NULL UNIQUE,
	"borough_area_hectare"	REAL NOT NULL,
	"green_area_hectare"	REAL NOT NULL,
	"blue_area_hectare"	REAL NOT NULL,
	"green+blue_area_hectare"	REAL NOT NULL,
	"percent_green"	REAL NOT NULL,
	"percent_blue"	REAL NOT NULL,
	"percent_green+blue"	INTEGER NOT NULL,
	PRIMARY KEY("area_id")
);
DROP TABLE IF EXISTS "traffic-flows-all-vehicles";
CREATE TABLE IF NOT EXISTS "traffic-flows-all-vehicles" (
	"area_id"	TEXT NOT NULL UNIQUE,
	"borough_id"	TEXT NOT NULL,
	"1993"	INTEGER NOT NULL,
	"1994"	INTEGER NOT NULL,
	"1995"	INTEGER NOT NULL,
	"1996"	INTEGER NOT NULL,
	"1997"	INTEGER NOT NULL,
	"1998"	INTEGER NOT NULL,
	"1999"	INTEGER NOT NULL,
	"2000"	INTEGER NOT NULL,
	"2001"	INTEGER NOT NULL,
	"2002"	INTEGER NOT NULL,
	"2003"	INTEGER NOT NULL,
	"2004"	INTEGER NOT NULL,
	"2005"	INTEGER NOT NULL,
	"2006"	INTEGER NOT NULL,
	"2007"	INTEGER NOT NULL,
	"2008"	INTEGER NOT NULL,
	"2009"	INTEGER NOT NULL,
	"2010"	INTEGER NOT NULL,
	"2011"	INTEGER NOT NULL,
	"2012"	INTEGER NOT NULL,
	"2013"	INTEGER NOT NULL,
	"2014"	INTEGER NOT NULL,
	"2015"	INTEGER NOT NULL,
	"2016"	INTEGER NOT NULL,
	"2017"	INTEGER NOT NULL,
	"2018"	INTEGER NOT NULL,
	"2019"	INTEGER NOT NULL,
	PRIMARY KEY("area_id")
);
DROP TABLE IF EXISTS "personal-well-being-borough-mean-scores";
CREATE TABLE IF NOT EXISTS "personal-well-being-borough-mean-scores" (
	"area_id"	TEXT NOT NULL UNIQUE,
	"area_name"	TEXT NOT NULL,
	"LifeSatisfaction"	INTEGER,
	"Worthwhile"	INTEGER,
	"Happiness"	INTEGER,
	"Anxiety"	INTEGER,
	PRIMARY KEY("area_id","area_name")
);
COMMIT;
